import React, { useState, useEffect } from 'react';

const SupplierEditForm = () => {
  const [formData, setFormData] = useState({
    id: '',
    name: '',
    email: '',
    phone: '',
    address: '',
    productId: ''
  });

  const [products, setProducts] = useState([]);
  const [responseMessage, setResponseMessage] = useState('');

  useEffect(() => {
    // Fetch products to populate the productId dropdown
    const fetchProducts = async () => {
      try {
        const response = await fetch('/api/products/getAllProducts');
        const data = await response.json();
        setProducts(data);
      } catch (error) {
        console.error('Error fetching products:', error);
      }
    };

    fetchProducts();
  }, []);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({
      ...formData,
      [name]: value
    });
  };

  const handleFetchSupplier = async (id) => {
    try {
      const response = await fetch(`/api/suppliers/getSupplier?id=${id}`);
      const data = await response.json();
      if (data) {
        setFormData({
          id: data.id,
          name: data.name,
          email: data.email,
          phone: data.phone,
          address: data.address,
          productId: data.productId || ''
        });
      } else {
        setResponseMessage('Supplier not found');
      }
    } catch (error) {
      console.error('Error fetching supplier:', error);
      setResponseMessage('Error fetching supplier');
    }
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await fetch('/api/suppliers/updateSupplier', {
        method: 'PUT',
        headers: {
          'Content-Type': 'application/json'
        },
        body: JSON.stringify(formData)
      });
      const data = await response.json();
      setResponseMessage(data.message || 'Supplier updated successfully');
    } catch (error) {
      console.error('Error updating supplier:', error);
      setResponseMessage('Error updating supplier');
    }
  };

  return (
    <div>
      <h2>Edit Supplier</h2>
      <form onSubmit={handleSubmit}>
        <div>
          <label>Supplier ID:</label>
          <input
            type="text"
            name="id"
            value={formData.id}
            onChange={handleChange}
            onBlur={() => handleFetchSupplier(formData.id)}
          />
        </div>
        <div>
          <label>Name:</label>
          <input
            type="text"
            name="name"
            value={formData.name}
            onChange={handleChange}
          />
        </div>
        <div>
          <label>Email:</label>
          <input
            type="email"
            name="email"
            value={formData.email}
            onChange={handleChange}
          />
        </div>
        <div>
          <label>Phone:</label>
          <input
            type="text"
            name="phone"
            value={formData.phone}
            onChange={handleChange}
          />
        </div>
        <div>
          <label>Address:</label>
          <input
            type="text"
            name="address"
            value={formData.address}
            onChange={handleChange}
          />
        </div>
        <div>
          <label>Product:</label>
          <select
            name="productId"
            value={formData.productId}
            onChange={handleChange}
          >
            <option value="">Select a product</option>
            {products.map((product) => (
              <option key={product.id} value={product.id}>
                {product.nome}
              </option>
            ))}
          </select>
        </div>
        <button type="submit">Update Supplier</button>
      </form>
      {responseMessage && <p>{responseMessage}</p>}
    </div>
  );
};

export default SupplierEditForm;
